// ==UserScript==
// @name        Google - NSA
// @namespace   http://se7en-soft.com
// @include     https://accounts.google.com/ServiceLogin?*
// @include     https://accounts.google.com/AccountChooser?*
// @include		https://accounts.google.com/Login?*
// @include		https://accounts.google.com/Logout?*
// @include		https://*.google.com/*
// @include		https://*.youtube.com/*
// @version     1.0.9
// @grant       none
// ==/UserScript==


//Defines the amount of time to delay functions that are wrapped inside of 'setTimeout' calls
const delay = 50;

//Defines an object that will be used to hold references to base64 encoded images which are used throughout the script
var images = {},
//Defines a pointer to the current URL that is loaded into the document
	cUrl;

(function(){
	//Initialize the 'images' object so that we properly display our pics
	images = {
		google: "data:image/png;base64,",
		//agent: "data:image/png;base64,",
		nsa: "data:image/png;base64,",
		gMail: "data:image/png;base64,",
		youTube: "data:image/png;base64,",
		maps: "data:image/png;base64,",
		agent2: "data:image/png;base64,",
	}

	//Figure out just where the Hell we are..
	cUrl = parseURL(document.location.href);

	//look for and slightly modify the 'Sign out' link.
	modLogoutLink();
	
	//Determine if we're on the page with the Account Chooser widget.
	if(cUrl.params["sacu"] == undefined){
		var reauthEmail = $('#reauthEmail');
		if(reauthEmail && reauthEmail.textContent.length > 0){
			//we're on a page that displays the last account we were logged in with and only gives us the option of filling the password for the same account.
			var acctChooserLink = $("#account-chooser-link");
			if(acctChooserLink) {
				clickElement('account-chooser-link');
				return;
			}
		} else {
			//Call the 'clearAccounts' method to ensure that local accounts are deleted if more than one is saved.
			clearAccounts();
		}
	}
	
	//Initialize basic page stuff such as background styling and removal of the footer bar, etc..
	intializePage();
	
	//Call 'modifyPage' method in order to adjust page elements and generally modify the fucking page.
	modifyPage();
})()

function modifyPage(){
	//Find the Div element with the 'Banner' class name. There should be only one of them.
	var banner = document.getElementsByClassName('banner')[0];
	if(banner) {
		//Dig in and find the two heading elements, H1 and H2.
		var h1 = $('h1', banner),
			h2 = $('h2', banner);
				
		if(h1)
			//Fix up the text in the first heading..
			h1.innerHTML = "<span style='color:white;'>One Tracker. All NSA Services<span>";
			
		if(h2){
			//Fix up the text in the second heading..
			h2.innerHTML = "<span style='color:#CCCCCC;'>Sign in with any NSA-approved account</span>";
			h2.setAttribute('style', 'margin-bottom:20px;');
		}
	}
		
	//Attempt to find the profile name element
	var profileName = document.getElementsByClassName('profile-name')[0];

	if(profileName){
		if(profileName.textContent.length > 0){
			//Patch it up with something a bit more meaningful.
			profileName.textContent = "007";
		}
	}
		
	//Find the Email input field
	var email = document.getElementById('Email');
	if(email)
		//Modify the placeholder value
		email.setAttribute('placeholder', 'Public Tracking Identifier');
	
	//Find the Password input field
	var password = document.getElementById('Passwd');
	if(password)
		//Modify the placeholder value
		password.setAttribute('placeholder', 'Secret Squirrel Code');
		
	//Try to find the blank profile image IMG element..
	var profileImage = document.getElementsByClassName('profile-img')[0];
	if(profileImage)
		//Swap out the source for our base64 encoded 'agent' image, above.
		profileImage.setAttribute('src', images.agent2);
			
	//Try to find the 'Create Account' hyper-link element..
	var newAccountLink = document.getElementById('link-signup');
	if(newAccountLink){
		//Correct the new account link text
		newAccountLink.textContent = "Create an NSA-approved account";
		newAccountLink.setAttribute('title', 'Please. For Pete\'s sake. Don\'t immediately remove the Google+ integration from your new account. We\'re really begging you not to. If you do, we\'re going to nag you to death or until you finally join the Dark Side. Resistance is futile.   +1');
	}
			
	//Try to find the paragraph element with the 'tagline' class name. There should be only one.
	var tagLine = document.getElementsByClassName('tagline')[0];
	if(tagLine)
		//Fix up the text in the tag line paragraph
		tagLine.textContent = "Any questions? We're listening.";
			
	//Try to find the 'Need Help?' hyper-link element.
	var helpLink = document.getElementById('link-forgot-passwd');
	if(helpLink)
		//Fix up the tool tip ('Title' attribute) to be a bit more meaningful and, more or less, reflects how Google actually uses this link.
		helpLink.setAttribute('title', 'Unless you only need to reset your password, don\'t bother asking us for any kind of help. We don\'t give a shit and won\'t bother to help you out.');
			
	//Find the 'Remember me' checkbox element. It's wrapped in a label so, we'll find the label and dig from there.
	var staySignedInLabel = document.getElementsByClassName('remember')[0];
	if(staySignedInLabel){
		//Dig for the span element that contains the outer text that we want to change
		var span = $('span', staySignedInLabel);
		if(span)
			//Change the text to say what Google means.
			span.textContent = "Continue to be tracked";
				
		//Find the tool tip bubble thing that's atttached to the OnMouseOver of the checkbox.
		var bubble = $('div.bubble-wrap div.bubble', staySignedInLabel);
		
		//Find the link destination for the 'Learn More' hyper-link.
		var linkHref = $('a', bubble).getAttribute('href');
			
		//Swap out the html content of the bubble tool tip thing.
		bubble.innerHTML = "For Our convienence, please keep this checked on all devices that you use. It makes it sooo much easier for US to continue tracking your every move.<br/><br/>Thank you so much,<br/>Your Big-Brother, Google.";
		
		//Create a new link element to replace the 'Learn More' link that we've destroyed when resetting the html content.
		var newLink = document.createElement('a');
		
		//Fill in the new link with the details of the old one.
		newLink.setAttribute('target', '_blank');
		newLink.setAttribute('href', linkHref);
		newLink.textContent = "Learn More";
		
		//Place the new link off to the right so it flows with the rest of the tool tip
		newLink.setAttribute('style', 'float:right;margin-right:10px;');
		
		//Set a proper tool tip on the 'Learn More' link so users know a bit more about where the link leads to ;-)
		newLink.setAttribute('title', 'Learn more about how we track your movements across all services and devices...');
		
		//Finally, stuff the new link into the DOM so it shows up in the bubble thing
		bubble.appendChild(newLink);
	}
	
	//Find the Sign in button
	var signInButton = document.getElementById('signIn');
	if(signInButton)
		//Patch up the text content to say what they really mean..
		signInButton.setAttribute('value', 'Give Up Privacy');
}

function modLogoutLink(){
	var locHref = parseURL(document.location.href);
	var links = document.documentElement.querySelectorAll("a"),
		target, href, isYT;
	
	isYT = locHref.host.indexOf("youtube.") != -1;
	if(isYT){
		var signOutButton = $("#yt-masthead-multilogin-sign-out");
		if(signOutButton){
			signOutButton.removeAttribute('onclick');
			signOutButton.addEventListener('click', function(e){
				e.preventDefault();
				document.location = "https://accounts.google.com/Logout?continue=https://accounts.google.com/ServiceLogin?continue=" + document.location.href;
			});
		}
	}
	
	for(var i = 0; i < links.length; i++){
		var lnk = links[i];
		href = parseURL(lnk.href);
		if(lnk.textContent.toLowerCase().indexOf("sign out") != -1){
			target = lnk;
			if(isYT){
				target.removeAttribute('onclick');
				target.href = "https://accounts.google.com/Logout?continue=https://accounts.google.com/ServiceLogin?continue=" + document.location.href;
			} else {
				target.addEventListener('click', function(e){
					e.preventDefault(); //prevent the link from registering the click event
					//manually redirect the page so that logout happens and then auto-redirects to the login page where the account chooser is then purged.
					document.location = "https://accounts.google.com/Logout?continue=https://accounts.google.com/ServiceLogin?continue=" + parseURL(target.href).params["continue"];
				});
			}
		}
	}
}

function clearAccounts(){
	//Find the account chooser title
	var accountChooserHeading = document.getElementById('accountchooser-title');
	if(accountChooserHeading)
		//Patch the content to be a bit more meaningful..
		accountChooserHeading.innerHTML = "Please select a tracking profile...";
	
	//This is not the page where you can add new accounts..
	//We need to re-navigate the page to where new accounts can be added
	var AddAccountLink = document.getElementById('account-chooser-add-account');
		
	if(AddAccountLink){
		//Re-navigate the document to our target page. The AddAccountLink points at our target so, we'll use its 'href' value and change the document location to it.
		//document.location.href = AddAccountLink.getAttribute('href');
		AddAccountLink.textContent = "Add New Tracking Profile";
	}
	//Find the list element that allows you to remove accounts
	removeLocalAccounts();
}

function intializePage(){
	if(parseURL(document.location).file != "ServiceLogin")
		return;

	//Fix the body background color so its not burning our our retinas
	document.body.setAttribute('style','background: #1B1B1B !important;');
	
	//Patch up the document title..
	document.title = "Sign in - Google/NSA Accounts";
	
	//Find the Google logo image
	var logoImage = document.getElementsByClassName('logo')[0];
	if(logoImage){
		//Create two span elements. One to place before the Google logo, one to place after.
		var pretext = document.createElement('span'),
			posttext = document.createElement('span');
				
		//Fill in a few details for the first span element..
		pretext.innerHTML = "&nbsp;&nbsp;An NSA&nbsp;";
		pretext.setAttribute('style', 'font-weight:bold;font-size:25pt;color:#CCCCCC;');
			
		//Fill in a few details for the second span element..
		posttext.textContent = " Corporation";
		posttext.setAttribute('style', 'font-weight:bold;font-size:25pt;color:#CCCCCC;');
			
		//Find the parent of the logo
		var parent = logoImage.parentNode;
		
		//Remove the logo from its parent element
		parent.removeChild(logoImage);
			
		//Swap out the default Google logo for our own
		logoImage.src = images.google;
		//Resize the logo to better fit the page
		logoImage.setAttribute('width', '160px');
		logoImage.setAttribute('height', '60px');
		//Remove the 'class' attribute so that our width and height take effect
		logoImage.removeAttribute('class');
			
		//Create a table element that we'll use to re-home the logo, along with our Pre and Post span elements.
		var table = createTable(1,3);
				
		//Fix the table so it's centered on the page where the logo should be.
		table.setAttribute('style', 'display:table;margin-left:auto;margin-right:auto;margin-top:20px;');
		
		//Find all the table cells..
		var cells = $$('tr td', table);
		
		//Place the first span into the first cell.
		cells[0].appendChild(logoImage);
		
		//Replace the logo into the center cell.
		cells[1].appendChild(pretext);
		
		//Place our second span into the last cell.
		cells[2].appendChild(posttext);
			
		//Finally, append the table to the former parent of the logo image.
		parent.appendChild(table);
	}
	
	//Find that useless footer bar..
	var footerBar = document.getElementsByClassName('google-footer-bar')[0];
	if(footerBar)
		//Nuke it!
		footerBar.parentNode.removeChild(footerBar);
	
	var wrapper = document.getElementsByClassName('wrapper')[0];
	if(wrapper){
		//Find the contentDiv element that hold the login form
		var contentDiv = $('div.main.content.clearfix', wrapper);
		if(contentDiv){
			//Remove the class attribute from the contentDiv element to clear Google's styles
			contentDiv.removeAttribute('class');

			//Create a table that will hold the login panel and an NSA logo
			var table = createTable(1, 2);
			//Set the table style so that it's centered in the page
			table.setAttribute('style', 'display:table;margin-left:auto;margin-right:auto;');
			
			//Get a collection of the table cells to make accessing them easier
			var cells = $$('tr td', table);
			
			//Remove the contentDiv element from the wrapper. We'll re-home it.
			var cd = wrapper.removeChild(contentDiv);
			//Re-home the removed contentDiv element to the first table cell
			cells[0].appendChild(cd);
			
			//Create a DIV element that we'll use to display the NSA logo as a background on
			var div = document.createElement('div');
			
			//Set the style for the DIV element so that it's the proper size for the logo image
			div.setAttribute('style', 'width:614px;min-width:614px;height:607px;min-height:607px;background: url(' + images.nsa + ') center center no-repeat #1B1B1B !important;');
			
			//Append the DIV element to the second table cell
			cells[1].appendChild(div);
			
			//Append the table to the wrapper element
			wrapper.appendChild(table);
			
			//Determine if the 'service' parameter is present in the current url
			if(cUrl.params["service"]){
			
				//Create a new image element that will be used to hold the service icon
				var svcImg = new Image();
				
				//Get the 'service' parameter value into a local variable
				var service = cUrl.params["service"];
				
				//Determine if the service is pointing at 'mail' [GMail]
				if(service === "mail"){
					//Assign the proper image from the 'images' object
					svcImg.src = images.gMail;
				}
				
				//Determine if the service is pointing at 'youtube'.
				if(service === "youtube"){
					//Assign the proper image from the 'images' object
					svcImg.src = images.youTube;
				}
				
				//Determine if the service is pointing at 'local' [google maps]
				if(service === "local"){ 
					//Assign the proper image from the 'images' object
					svcImg.src = images.maps;
				}
				
				//Sanity check
				if(svcImg != null){
					//Adjust the image's style so that it floats up and away to the top-left corner of the 'contentDiv' element
					svcImg.setAttribute('style', 'float:left;max-width:80px;margin-left:-50px;margin-top:-60px;');
				
					//Find the profile image iFrame
					var ccIFrame = document.getElementById('cc_iframe_parent');
					if(ccIFrame){
						//Place the image into the DOM, inserting it before the iFrame that contains the profile image
						ccIFrame.parentNode.insertBefore(svcImg, ccIFrame);
						//Create a 'DIV' element that will be used to clear the floated image we inserted, above.
						var clearBreak = document.createElement('div');
						//Set the proper style needed to clear the floated image
						clearBreak.setAttribute('style', 'clear:both;');
						//Place the 'DIV' into the DOM, inserted between the image and the iFrame that contains the profile image
						ccIFrame.parentNode.insertBefore(clearBreak, ccIFrame);
					}
				}
			}
		}
	}
}

function removeLocalAccounts(){
	var RemAccountLink = document.getElementById('edit-account-list');
	if(RemAccountLink){
		//Patch the text content of the element..
		RemAccountLink.textContent = "Remove Tracking Profile";
		//Automate a 'click' on the Edit-Account-List element so that the accounts can be removed
		clickElement('edit-account-list');
						
		//Give the page a 100ms to update elements in response to clicking the Edit-Account-List element
		setTimeout(function(){
			//Find the Account-List element
			var acctList = document.getElementById('account-list');
			if(acctList){
				//Get a collection of the buttons in the list
				var buttons = $$('li button', acctList);
				//Sanity check!	
				if(buttons.length > 0){
					//Loop through the button collection
					for(var b = 0; b < buttons.length; b++){
					
						var button = buttons[b],
							emailAddress = button.value;
						
						//Automate a 'click' on each button
						clickElement(button.id);
						
						//---------------------------------------------------------------------------------------------------------------------------------
						// This bit of script was taken from the page and is being used against it in order to remove the local accounts.
						var params = [];
						params['Email'] = emailAddress; 
							
						try{
							G_sendXmlHttpRequest(params, 'RemoveLocalAccount', gaia.bind(gaia.AccountChooser, handleGaiaRemoveResponse(emailAddress))); 
						}
						catch(e){
							alert(e);
						}
						//----------------------------------------------------------------------------------------------------------------------------------
					}
					
					//Set a time out of 100ms to allow the page elements to update after clicking each button and calling the remove AJAX call on them
					setTimeout(function(){
						//Find the element with the Edit-Account-List id. It should now be an anchor element
						var doneLink = document.getElementById('edit-account-list');
						
						//Sanity check!
						if(doneLink){
						
							//Fetch the link destination from the anchor
							var href = doneLink.getAttribute('href');
							
							//Forcefully navigate the page to the link destination to ensure local accounts are cleared.
							document.location.href = href;
						}
					}, delay);
						
						
				}
			}
		}, delay);
	}
}

function handleGaiaRemoveResponse(emailAddress){
	//----------------------------------------------------------------------------------------------------
	// Taken directly from the page. Called to handle removal of local account objects.
	return function(response) {
		if (response.status == 200) {
			try {
				var elem = document.getElementById('account-' + emailAddress);
				if (elem) {
					gaia.AccountChooser.accountList_.removeChild(elem);
					if (gaia.AccountChooser.accountList_.getElementsByTagName('li').length == 0) {
						gaia.AccountChooser.createAndAppendEmptyNotice_();
						gaia.AccountChooser.updateDoneLinkActionForEmptyList_();
					}
				}
			} 
			catch (err) {
			
			};
		}
	}; 
	//----------------------------------------------------------------------------------------------------
}

function createTable(rows, cols){
	//Create a new table element
	var table = document.createElement('table');
	//Loop 'n' times to create the proper number of rows for the table
	for(var i = 0; i < rows; i++){
		//Create a new table row element
		var row = document.createElement('tr');
		//Loop 'n' times to create the columns
		for(var j = 0; j < cols; j++){
			//Create a new table cell element
			var col = document.createElement('td');
			//Append the column to the table row we created above
			row.appendChild(col);
		}
		//Append the table row to the table element
		table.appendChild(row);
	}
	//Tada! Return the table element to the caller
	return table;
}

function clickElement(id){
	//Find the element in the document
	var elm = document.getElementById(id);
	if(elm){
		//Create a new event 
		var evt = document.createEvent("MouseEvent");
		//Initialize it as a mouse event
		evt.initMouseEvent('click', true, true, window, 0, 0, 0, 0, 0, false, false, false, false, 0, null);
		//Dispatch the event on the found DOM element
		elm.dispatchEvent(evt);
	}
}

